function getNameOfBottomProgramPart1(data) {
    const names = {};
    let bottomProgram;

    data.forEach(item => {
        if (names[item.name]) {
            names[item.name]++;
        } else {
            names[item.name] = 1;
        }

        if (item.programs) {
            item.programs.forEach(program => {
                if (names[program]) {
                    names[program]++;
                } else {
                    names[program] = 1;
                }
            });
        }
    });

    for (let name in names) {
        //The name that appears only once is the bottom program
        if (names[name] === 1) {
            bottomProgram = name;
            break;
        }
    }

    return bottomProgram;
}

